import React from 'react';

const Introduction = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>Introduction</h1>
    </div>
  );
};

export default Introduction;
